/*------------------------------------------------------------
*        Script SQLSERVER 
------------------------------------------------------------*/
CREATE DATABASE MegaCastings
GO

USE MegaCastings
GO

/*------------------------------------------------------------
-- Table: CASTINGS
------------------------------------------------------------*/
CREATE TABLE CASTINGS(
	ID_CASTING          INT IDENTITY (1,1) NOT NULL ,
	LABEL               VARCHAR (50)  ,
	DOM_METIERS         VARCHAR (50)  ,
	METIERS             VARCHAR (50) NOT NULL ,
	TYPE_CONTRACT       VARCHAR (50) NOT NULL ,
	DUREE_DIFFUSION     INT   ,
	DATE_DEB_CONTRACT   DATETIME2 NOT NULL ,
	NB_POSTES           INT  NOT NULL ,
	LOCALISATION        VARCHAR (50) NOT NULL ,
	DESC_POSTE          TEXT   ,
	DESC_PROFIL         TEXT   ,
	COORDONNEES         VARCHAR (50)   ,
	CONSTRAINT CASTINGS_PK PRIMARY KEY (ID_CASTING)
);


/*------------------------------------------------------------
-- Table: PACK
------------------------------------------------------------*/
CREATE TABLE PACK(
	ID_PACK     INT IDENTITY (1,1) NOT NULL ,
	NAME_PACK   VARCHAR (50)  ,
	PRICE       INT    ,
	CONSTRAINT PACK_PK PRIMARY KEY (ID_PACK)
);


/*------------------------------------------------------------
-- Table: ORGANISATION
------------------------------------------------------------*/
CREATE TABLE ORGANISATION(
	ID_ORG       INT IDENTITY (1,1) NOT NULL ,
	NAME_ORG     VARCHAR (150) NOT NULL ,
	URL_ORG      VARCHAR (1000) NOT NULL ,
	EMAIL_ORG    VARCHAR (100)  ,
	TEL_ORG      VARCHAR (50) NOT NULL ,
	ADRESS_ORG   VARCHAR (100)  ,
	ID_CASTING   INT  NOT NULL ,
	ID_PACK      INT  NOT NULL  ,
	CONSTRAINT ORGANISATION_PK PRIMARY KEY (ID_ORG)

	,CONSTRAINT ORGANISATION_CASTINGS_FK FOREIGN KEY (ID_CASTING) REFERENCES CASTINGS(ID_CASTING)
	,CONSTRAINT ORGANISATION_PACK0_FK FOREIGN KEY (ID_PACK) REFERENCES PACK(ID_PACK)
);


/*------------------------------------------------------------
-- Table: CIVILITE
------------------------------------------------------------*/
CREATE TABLE CIVILITE(
	ID_CIVILITE      INT IDENTITY (1,1) NOT NULL ,
	LABEL_CIVILITE   VARCHAR (50) NOT NULL  ,
	CONSTRAINT CIVILITE_PK PRIMARY KEY (ID_CIVILITE)
);


/*------------------------------------------------------------
-- Table: USERS
------------------------------------------------------------*/
CREATE TABLE USERS(
	ID_USER          INT IDENTITY (1,1) NOT NULL ,
	USER_FIRSTNAME   VARCHAR (100)  ,
	USER_LASTNAME    VARCHAR (100) NOT NULL ,
	USERNAME         VARCHAR (50)  ,
	USER_PASSWORD    VARCHAR (100)  ,
	USER_MAIL        VARCHAR (1000) NOT NULL ,
	USER_NAISSANCE   DATETIME2 NOT NULL ,
	ID_CIVILITE      INT  NOT NULL  ,
	CONSTRAINT USERS_PK PRIMARY KEY (ID_USER)

	,CONSTRAINT USERS_CIVILITE_FK FOREIGN KEY (ID_CIVILITE) REFERENCES CIVILITE(ID_CIVILITE)
);


/*------------------------------------------------------------
-- Table: CATEGORIES
------------------------------------------------------------*/
CREATE TABLE CATEGORIES(
	ID_CAT      INT IDENTITY (1,1) NOT NULL ,
	CAT_LABEL   VARCHAR (50)   ,
	CONSTRAINT CATEGORIES_PK PRIMARY KEY (ID_CAT)
);


/*------------------------------------------------------------
-- Table: FILTRES
------------------------------------------------------------*/
CREATE TABLE FILTRES(
	ID_FILTRE      INT IDENTITY (1,1) NOT NULL ,
	CAT_LABEL      VARCHAR (50)  ,
	LABEL_FILTRE   VARCHAR (75) NOT NULL  ,
	CONSTRAINT FILTRES_PK PRIMARY KEY (ID_FILTRE)
);


/*------------------------------------------------------------
-- Table: POSTULER
------------------------------------------------------------*/
CREATE TABLE POSTULER(
	ID_CASTING   INT  NOT NULL ,
	ID_USER      INT  NOT NULL  ,
	CONSTRAINT POSTULER_PK PRIMARY KEY (ID_CASTING,ID_USER)

	,CONSTRAINT POSTULER_CASTINGS_FK FOREIGN KEY (ID_CASTING) REFERENCES CASTINGS(ID_CASTING)
	,CONSTRAINT POSTULER_USERS0_FK FOREIGN KEY (ID_USER) REFERENCES USERS(ID_USER)
);


/*------------------------------------------------------------
-- Table: APPARTIENT_CASTING
------------------------------------------------------------*/
CREATE TABLE APPARTIENT_CASTING(
	ID_CASTING   INT  NOT NULL ,
	ID_CAT       INT  NOT NULL  ,
	CONSTRAINT APPARTIENT_CASTING_PK PRIMARY KEY (ID_CASTING,ID_CAT)

	,CONSTRAINT APPARTIENT_CASTING_CASTINGS_FK FOREIGN KEY (ID_CASTING) REFERENCES CASTINGS(ID_CASTING)
	,CONSTRAINT APPARTIENT_CASTING_CATEGORIES0_FK FOREIGN KEY (ID_CAT) REFERENCES CATEGORIES(ID_CAT)
);


/*------------------------------------------------------------
-- Table: APPARTENIR_FILTRE
------------------------------------------------------------*/
CREATE TABLE APPARTENIR_FILTRE(
	ID_CASTING   INT  NOT NULL ,
	ID_FILTRE    INT  NOT NULL  ,
	CONSTRAINT APPARTENIR_FILTRE_PK PRIMARY KEY (ID_CASTING,ID_FILTRE)

	,CONSTRAINT APPARTENIR_FILTRE_CASTINGS_FK FOREIGN KEY (ID_CASTING) REFERENCES CASTINGS(ID_CASTING)
	,CONSTRAINT APPARTENIR_FILTRE_FILTRES0_FK FOREIGN KEY (ID_FILTRE) REFERENCES FILTRES(ID_FILTRE)
);


